const CharacterCard = ({data}) => {
  return (
    <div>
    <div className="characterImage">
      <figure>
        <img src={data.images.sm}/>
        
      </figure>
      </div>
      {data.name}
        {data.biography.fullName}
        {data.biography.publisher}
      
    </div>
  )
}

export default CharacterCard
